import {
    Layout,
    Page,
    Button,
    Heading
} from '@shopify/polaris';

class Login extends React.Component {
    render(){
        return (
            <Page>
                <Layout>
                    <Button url="/">Sign Out</Button>
                    <Heading>Dashboard page</Heading>
                </Layout>
            </Page>
        );
    }
}

export default Login;
